activated = true

-- key, zoom_factor, crouch reduce recoil
weapon_options = {
	{"ak", 1.6666666269302368, false},
	{"mp5", 1.6666666269302368, false},
	{"smg", 1.3636363744735718, false},
	{"thompson", 1.3636363744735718, false},
	{"lr", 1.6666666269302368, false},
	{"m2", 1.6666666269302368, true},
}

