available_function_keys = {"activate_deactivate", "activate", "deactivate", "legit_unreal", "legit", "unreal", "next_weapon", "next_attachment", "silencer_off", "silencer_on", "hipfire", "holo_off"}

function ExecFunction(func_key, arg)
	OutputLogMessage("Executing Function: %s\n", func_key)
	if func_key == "hipfire" then
		Hipfire()
	elseif func_key == "activate_deactivate" then
		ActivateDeactivate()
	elseif func_key == "activate" then
		Activate()
	elseif func_key == "deactivate" then
		Deactivate()
	elseif func_key == "legit_unreal" then
		LegitUnreal()
	elseif func_key == "legit" then
		Legit()
	elseif func_key == "unreal" then
		Unreal()
	elseif func_key == "next_weapon" then
		NextWeapon()
	elseif func_key == "next_attachment" then
		NextAttachment()
	elseif func_key == "silencer_on" then
		SilencerOn()
	elseif func_key == "silencer_off" then
		SilencerOff()
	elseif func_key == "holo_off" then
		HoloOff()
	end
end

function Hipfire() 
	PressMouseButton(1)
	local start_ms = GetRunningTime()

	local weapon_option = weapon_options[selected_weapon]

	-- fire script on main mouse button
	FullAutoRecoil(start_ms, weapon_option, true)

	ReleaseMouseButton(1)
end

function HoloOff()
	OutputLogMessage("Holo off\n")
	ListRemove(selected_attachments, "holo")
	if not ListContains(selected_attachments, "ironsight") then
		table.insert(selected_attachments, "ironsight")
	end
end

function SilencerOn()
	OutputLogMessage("Silencer on\n")
	if not ListContains(selected_attachments, "silencer") then
		table.insert(selected_attachments, "silencer")
	end
end

function SilencerOff()
	OutputLogMessage("Silencer off\n")
	ListRemove(selected_attachments, "silencer")
end

function ActivateDeactivate()
	activated = not activated
	if activated then
		OutputLogMessage("Script activated\n")
	else
		OutputLogMessage("Script deactivated\n")
	end
end

function Activate()
	activated = true
	OutputLogMessage("Script activated\n")
end

function Deactivate()
	activated = false
	OutputLogMessage("Script deactivated\n")
end

function LegitUnreal()
	legit = not legit
	if legit then
		OutputLogMessage("Legit Mode\n")
	else
		OutputLogMessage("Unreal Mode\n")
	end
end

function Legit()
	legit = true
	OutputLogMessage("Legit Mode\n")
end

function Unreal()
	legit = false
	OutputLogMessage("Unreal Mode\n")
end

function GetFactor(zoom_factor_bare, hipfire)
	local zoom_factor = 1 / zoom_factor_bare
	--OutputLogMessage("zoom_factor: %f\n", zoom_factor)
	local fov = fov_base

	if hipfire then
		fov = fov * 1.75
	else
		if (#selected_attachments == 0 or ListContains(selected_attachments, "ironsight")) then
			fov = fov * zoom_factor
		end

		if (ListContains(selected_attachments, "holo")) then
			fov = fov * holo
		end

		if (ListContains(selected_attachments, "8x")) then
			fov = fov * eightex
		end
	end

	return (fov / 666.6666666666666666) * sens 
end 

function GetAdjusts()
	local x_adjust = 1
	local y_adjust = 1

	if (legit) then

		y_adjust = (100 - legit_percentage_vertical) / 100

		x_adjust = (100 - legit_percentage_horizontal) / 100
	
	end

	if (ListContains(selected_attachments, "silencer") or ListContains(selected_attachments, "8x")) then
		x_adjust = x_adjust * 0.8
		y_adjust = y_adjust * 0.8
	end

	return x_adjust, y_adjust
end

function AtomicSleep(millis)
    local endTime = GetRunningTime() + millis
    while GetRunningTime() < endTime do
    end
end

function FullAutoRecoil(start_ms, option, hipfire)
	--OutputLogMessage("FullAutoRecoil, hipfire: %s\n", tostring(hipfire))
	-- needed for calcing the diff to move
	local last_position = {0, 0}

	local recoil_graph = recoil_graphs_auto[option[1]]

	local x_adjust, y_adjust = GetAdjusts(option[2])

	local factor = GetFactor(option[2], hipfire)
	
	-- pixel pool, the amount of non full pixels that are left over after using closest_int
	local x_px_pool = 0
	local y_px_pool = 0

	if hipfire then
		repeat
    		-- values work based on a recoil graph that contains the recoil 
    		-- for each millisecond	
			local passed_ms = GetRunningTime() - start_ms

			--OutputLogMessage("passed_ms: %d\n", passed_ms)

			local position = recoil_graph[passed_ms]
			if(position ~= nil and (IsMouseButtonPressed(3) or hipfire)) then
			
				local crouched = IsModifierPressed("ctrl") and option[3]

    			-- how much we should move raw
				local now_move_y = position[2] - last_position[2]

				-- calculate pixel to move
				local move_y_px = (now_move_y / factor) * y_adjust

				if crouched then
					move_y_px = move_y_px / 2
				end

				local y_px_leftovers = y_px_pool

				-- add left over pixel from previous iteration
				local move_y_px_w_leftovers = move_y_px + y_px_leftovers
	    		
				-- floor it 
				local move_y_px_floored = closest_int(move_y_px_w_leftovers)

				-- get left over pixel once again
				y_px_pool = move_y_px_w_leftovers - move_y_px_floored

				-- update the total that we moved
				last_position[2] = position[2]

				-- same for x
				local now_move_x = position[1] - last_position[1]

				local move_x_px = (now_move_x / factor) * x_adjust

				if crouched then
					move_x_px = move_x_px / 2
				end

				local x_px_leftovers = x_px_pool

				local move_x_px_w_leftovers = move_x_px + x_px_leftovers

				local move_x_px_floored = closest_int(move_x_px_w_leftovers)

				x_px_pool = move_x_px_w_leftovers - move_x_px_floored

				last_position[1] = position[1]

				-- adjust recoil
				MoveMouseRelative(-move_x_px_floored, -move_y_px_floored)

				--OutputLogMessage("passed_ms: %f\nMoveMouseRelative(%f, %f)\nfactor: %f\n", passed_ms, -move_x_px_floored, -move_y_px_floored, factor)
				--OutputLogMessage("now_move_y: %f\nmove_y_px: %f\nmove_y_px_w_leftovers: %f\nmove_y_px_floored: %f\ny_px_leftovers: %f\ny_px_pool: %f\n\n", passed_ms, -move_x_px_floored, -move_y_px_floored, factor, now_move_y, move_y_px, move_y_px_w_leftovers, move_y_px_floored, y_px_leftovers, y_px_pool)
				--OutputLogMessage("now_move_x: %f\nmove_x_px: %f\nmove_x_px_w_leftovers: %f\nmove_x_px_floored: %f\nx_px_leftovers: %f\nx_px_pool: %f\n\n", now_move_x, move_x_px, move_x_px_w_leftovers, move_x_px_floored, x_px_leftovers, x_px_pool)
			end

			if use_atomic_sleep then
				AtomicSleep(math.random(1,3))
			else
				Sleep(1)
			end
		until not IsMouseButtonPressed(HIPFIRE_BUTTON)--and not IsMouseButtonPressed(1)
	else
		repeat
    		-- values work based on a recoil graph that contains the recoil 
    		-- for each millisecond	
			local passed_ms = GetRunningTime() - start_ms

			--OutputLogMessage("passed_ms: %d\n", passed_ms)

			local position = recoil_graph[passed_ms]
			if(position ~= nil and (IsMouseButtonPressed(3) or hipfire)) then
			
				local crouched = IsModifierPressed("ctrl") and option[3]

    			-- how much we should move raw
				local now_move_y = position[2] - last_position[2]

				-- calculate pixel to move
				local move_y_px = (now_move_y / factor) * y_adjust

				if crouched then
					move_y_px = move_y_px / 2
				end

				local y_px_leftovers = y_px_pool

				-- add left over pixel from previous iteration
				local move_y_px_w_leftovers = move_y_px + y_px_leftovers
	    		
				-- floor it 
				local move_y_px_floored = closest_int(move_y_px_w_leftovers)

				-- get left over pixel once again
				y_px_pool = move_y_px_w_leftovers - move_y_px_floored

				-- update the total that we moved
				last_position[2] = position[2]

				-- same for x
				local now_move_x = position[1] - last_position[1]

				local move_x_px = (now_move_x / factor) * x_adjust

				if crouched then
					move_x_px = move_x_px / 2
				end

				local x_px_leftovers = x_px_pool

				local move_x_px_w_leftovers = move_x_px + x_px_leftovers

				local move_x_px_floored = closest_int(move_x_px_w_leftovers)

				x_px_pool = move_x_px_w_leftovers - move_x_px_floored

				last_position[1] = position[1]

				-- adjust recoil
				MoveMouseRelative(-move_x_px_floored, -move_y_px_floored)

				--OutputLogMessage("passed_ms: %f\nMoveMouseRelative(%f, %f)\nfactor: %f\n", passed_ms, -move_x_px_floored, -move_y_px_floored, factor)
				--OutputLogMessage("now_move_y: %f\nmove_y_px: %f\nmove_y_px_w_leftovers: %f\nmove_y_px_floored: %f\ny_px_leftovers: %f\ny_px_pool: %f\n\n", passed_ms, -move_x_px_floored, -move_y_px_floored, factor, now_move_y, move_y_px, move_y_px_w_leftovers, move_y_px_floored, y_px_leftovers, y_px_pool)
				--OutputLogMessage("now_move_x: %f\nmove_x_px: %f\nmove_x_px_w_leftovers: %f\nmove_x_px_floored: %f\nx_px_leftovers: %f\nx_px_pool: %f\n\n", now_move_x, move_x_px, move_x_px_w_leftovers, move_x_px_floored, x_px_leftovers, x_px_pool)
			end

			if use_atomic_sleep then
				AtomicSleep(math.random(1,3))
			else
				Sleep(1)
			end
		until not IsMouseButtonPressed(1)
	end

	
end

-- also activates the script
function ExecWeaponBind(v)
	activated = true
	selected_weapon = GetIndex(weapon_options , v)
	OutputLogMessage("set activated and the selected weapon %s\n", v)
end

function ExecAttachmentBind(v)
	table.insert(selected_attachments, v)
	OutputLogMessage("inserted attachment %s\n", v)
end

function GetIndex(values, key) 
	local index={}
	for k,v in pairs(values) do
	   index[v[1]]=k
	end
	return index[key]
end

function ExecuteBind(bindValue, arg)
	if bindValue == nil then
		return
	end
	OutputLogMessage("bindValue: %s\n", bindValue)

	local split = {}
	for i in bindValue:gmatch("([^, ]+)") do
		split[#split + 1] = i
	end

	local attachments_not_cleared = true

	for i, v in ipairs(split) do
		if SetContains(recoil_graphs_auto, v) then
			ExecWeaponBind(v)
		elseif ListContains(attachment_options, v) then
			if attachments_not_cleared then
				--OutputLogMessage("cleared attachments\n")
				for k in pairs(selected_attachments) do
			    	selected_attachments[k] = nil
				end
				attachments_not_cleared = false
			end
			ExecAttachmentBind(v)
		elseif ListContains(available_function_keys, v) then
			ExecFunction(v, arg)
		end
	end

	print_info()
end

function ListRemove(tab, val)
	for index, value in ipairs(tab) do
        if value == val then
            table.remove(tab, index)
        end
    end
end

function ListContains (tab, val)
    for index, value in ipairs(tab) do
        if value == val then
            return true
        end
    end

    return false
end

function SetContains(set, key)
    return set[key] ~= nil
end

function BindMapping(event, arg)
	local alt_down = IsModifierPressed("alt")
    local ctrl_down = IsModifierPressed("ctrl")

	if (event == "MOUSE_BUTTON_PRESSED" and arg == 3) then
		if alt_down then
			ExecuteBind(MB3_ALT, event, arg)
		elseif ctrl_down then
			ExecuteBind(MB3_CTRL, event, arg)
		else
			ExecuteBind(MB3, event, arg)
		end
	end

	if (event == "MOUSE_BUTTON_PRESSED" and arg == 4) then
		if alt_down then
			ExecuteBind(MB4_ALT, event, arg)
		elseif ctrl_down then
			ExecuteBind(MB4_CTRL, event, arg)
		else
			ExecuteBind(MB4, event, arg)
		end
	end

	if (event == "MOUSE_BUTTON_PRESSED" and arg == 5) then
		if alt_down then
			ExecuteBind(MB5_ALT, event, arg)
		elseif ctrl_down then
			ExecuteBind(MB5_CTRL, event, arg)
		else
			ExecuteBind(MB5, event, arg)
		end
	end

	if (event == "MOUSE_BUTTON_PRESSED" and arg == 6) then
		if alt_down then
			ExecuteBind(MB6_ALT, event, arg)
		elseif ctrl_down then
			ExecuteBind(MB6_CTRL, event, arg)
		else
			ExecuteBind(MB6, event, arg)
		end
	end

	if (event == "MOUSE_BUTTON_PRESSED" and arg == 7) then
		if alt_down then
			ExecuteBind(MB7_ALT, event, arg)
		elseif ctrl_down then
			ExecuteBind(MB7_CTRL, event, arg)
		else
			ExecuteBind(MB7, event, arg)
		end
	end

	if (event == "MOUSE_BUTTON_PRESSED" and arg == 8) then
		if alt_down then
			ExecuteBind(MB8_ALT, event, arg)
		elseif ctrl_down then
			ExecuteBind(MB8_CTRL, event, arg)
		else
			ExecuteBind(MB8, event, arg)
		end
	end
end

function OnEvent(event, arg)
	local start_ms = GetRunningTime()

	local weapon_option = weapon_options[selected_weapon]

	-- fire script on main mouse button
	if (event == "MOUSE_BUTTON_PRESSED" and arg == 1 and activated) then
		FullAutoRecoil(start_ms, weapon_option)
	elseif (event == "MOUSE_BUTTON_PRESSED" and arg == HIPFIRE_BUTTON and activated and not IsModifierPressed("alt")) then
		Hipfire()
	elseif (event == "PROFILE_ACTIVATED") then
    	-- enable trigger onevent when mb1 is pressed
        EnablePrimaryMouseButtonEvents(true)
        print_info()
    else
		BindMapping(event, arg)
    end 

    if show_pressed_mouse_button then
    	OutputLogMessage("Pressed mouse button: %d\n", arg)
    end
end

function print_info() 
	OutputLogMessage("\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n")
	mode = "unreal"
	if(legit) then
		mode = "legit"
	end

	OutputLogMessage("Weapon: %s, Mode: %s, Activated: %s\n", weapon_options[selected_weapon][1], mode, tostring(activated))

    OutputLogMessage("Attachments:\n")
	for index, attachment in ipairs(selected_attachments) do
		OutputLogMessage("-%s\n", attachment)
	end
end

function closest_int(val)
	if val > 0 then
		return math.floor(val)
	else
		return math.ceil(val)
	end
end

